package com.zbyj.Yazhou.LeftCompanyProgram.CompanyPage;import android.annotation.SuppressLint;import android.os.Parcel;import android.os.Parcelable;import java.io.Serializable;/** * 构造WebView控件的信息 */@SuppressLint("ParcelCreator")public class WEB_VALUES_ACT implements Serializable {    private String _title;    /**     * 默认构造一个URL其他为默认     *     * @param Url     */    private String _url = "";    public WEB_VALUES_ACT(String Url) {        this._url = Url;    }    protected WEB_VALUES_ACT(Parcel in) {    }    /**     * 获取构造的URL地址信息     *     * @return     */    public String get_url() {        return _url;    }    /**     * 获取设置的Title     *     * @return     */    public String get_title() {        return this._title;    }    /**     * 设置Title     */    public void set_title(String title) {        this._title = title;    }}